package resources

func NewInternalServerErrorResource() *BaseResource {
	resource := NewBaseResource()
	elements := []Element{
		{
			Type:    "web",
			Content: `<html><head><style>body div {display: block;width: 100%;margin: 0px auto;text-align: center;}body div h2 {color: #d9534f}</style></head><body><div><img src="data:image/png;base64," /><h2>LỖI MÁY CHỦ</h2></div></body></html>`,
		},
	}
	resource.Data.Metadata.Elements = elements
	resource.Data.Metadata.SubmitButton = SubmitButton{
		Label:           "Đóng",
		BackgroundColor: "#0275d8",
		CTA:             "close",
		URL:             "https://us-central1-index-hackathon.cloudfunctions.net/index",
	}
	return resource
}
